import { createRouter, createWebHistory } from 'vue-router';



const routes = [
  { path: '/', 
    name: 'UserApp',
     component: () => import('@/components/UserApp.vue') 
    },
    { path: '/sign-up', 
      name: 'SignUp',
        component: () => import('@/components/SignUp.vue') 
       },
       
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
